(1, 2, 'en', 'Double Cheesburger', 'We make it like we always have: two slices of processed cheddar cheese with two 100% pure Canadian beef patties, pickles, onions, ketchup and mustard on a freshly toasted bun.', ''),
(2, 2, 'fr', 'Double Hamburger avec Fromage', 'Toujours prpar de la mme faon : deux tranches de fromage cheddar fondu et deux pts de buf canadien pur  100 %, garnis de cornichons, doignons, de ketchup et de moutarde sur un petit pain frachement grill.\r\n', ''),
(3, 3, 'en', 'Angus Classic', 'Bigger really is better when you meet our third-pound* 100% Angus beef patty on a delicious bakery style sesame bun. We then add two slices of savoury bacon and processed cheddar cheese and top it off with crisp red onions and crinkle-cut pickles.', 'angus-classic'),
(4, 3, 'fr', 'Angus Classique', 'Notre sandwich Tiers de livre Angus avec bacon et fromage commence par un gnreux Tiers de livre de buf Angus pur \r\n100 % savoureux  souhait, garni de rondelles doignons rouges et de tranches de cornichons auxquelles nous ajoutons deux tranches de bacon savoureux et du fromage cheddar fondu, le tout servi sur un petit pain gourmet avec graines de ssame.', 'angus-classique'),
(5, 4, 'en', 'Big Burger', 'One of a kind, legendary Big Burger, made with two 100% Canadian beef patties, special sauce, crisp lettuce, processed cheddar cheese, pickles and onions on a toasted sesame seed bun. Nothing compares to the taste.', 'big-burger'),
(6, 4, 'fr', 'Grand Burger', 'Unique en son genre, le lgendaire Big Burger est fait de deux pts de buf canadien pur  100 %, accompagns dune sauce spciale, de laitue croquante, de fromage cheddar fondu, de cornichons et doignons, le tout dpos sur un petit pain au ssame grill. Un got sans gal!', 'grand-burger'),
(7, 5, 'en', 'Cheeseburger', 'A slice of melted processed cheddar cheese on a juicy, 100% pure Canadian beef patty with tangy pickles and onions, ketchup and mustard on a freshly-toasted bun.', 'cheeseburger'),
(8, 5, 'fr', 'Hamburger avec fromage', 'Une tranche de fromage cheddar fondu dpose sur un pt tendre de buf canadien pur  100 %, le tout garni de cornichons aciduls, doignons, de ketchup et de moutarde sur un petit pain frachement grill', 'hamburger-avec-fromage'),
(9, 7, 'en', 'Mediterranean Wrap', 'Loaded with fresh tomatoes, cucumbers, red onions, shredded lettuce and feta cheese, topped with lemon crispy onions and mediterranean sauce, all wrapped in a warm whole wheat soft-shell tortilla.', 'mediterranean-wrap'),
(10, 7, 'fr', 'Wrap mditerranen aux lgumes', 'Des tomates fraches, du concombre, des oignons rouges, de la laitue en lanires et du fromage fta, le tout garni doignons croustillants assaisonns au citron et de sauce mditerranenne, enroul dans une tortilla souple de bl entier chaude.', 'wrap-mditerranen-aux-lgumes');

